import React, { useRef, useState } from "react";
import singer from "./singer.png";
import "./Register.css";
import Validation from "./Validation";

import { useNavigate } from "react-router-dom";

const Registration = () => {
  const initialDetails = {
    name: "",
    UserName: "",
    email: "",
    number: "",
    checkbox: false,
  };

  const name = useRef();
  const email = useRef();
  const UserName = useRef();
  const number = useRef();

  const [details, setDetails] = useState(initialDetails);
  const [disable, setDisable] = useState("typing");

  const [errors, setError] = useState({});

  const handleChange = (e) => {
    const { name, value } = e.target;
    setDetails((prev) => {
      return { ...prev, [name]: value };
    });
  };
  let navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    setDetails(initialDetails);
    setDisable("submitted");
    setError(Validation(details));
    if (
      name.current.value &&
      UserName.current.value &&
      email.current.value &&
      number.current.value
    ) {
      localStorage.setItem("name", name.current.value);
      localStorage.setItem("UserName", UserName.current.value);
      localStorage.setItem("email", email.current.value);
      localStorage.setItem("number", number.current.value);
      alert("account Created Successfully!!");

      let path = `/Onboarding`;
      navigate(path);
    }
    console.log(details);
  };

  return (
    <div className="flex">
      <div className="relative w-full">
        <img className="w-full h-screen" src={singer} alt="not found" />
        <p className="w-5/6 h-143 absolute bottom-16 text-white left-16  text-6xl font-semibold">
          Discover new things on Superapp
        </p>
      </div>
      <div className="relative w-full bg-black">
        <h4 className="w-72 h-24 absolute top-16 right-40 text-green-600 text-6xl font-single">Superapp</h4>
        <h4 className="w-72 h-28 absolute top-36 right-36 text-white">Create your new account </h4>
        <form onSubmit={handleSubmit}>
        <div className="absolute top-48">
          <input
            className="w-96 h-16 mb-4 bg-slate-800 rounded absolute top-0 left-60"
            type="text"
            placeholder="name"
            name="name"
            onChange={handleChange}
            value={details.name}
            ref={name}
          />
          {/* <p className="error-message1" onClick={handleMessage} value={message}>
            {" "}
            Field is Required
          </p>  */}

          {errors.name && <p className="error-message1">{errors.name}</p>}
          <input
            className="UserName"
            type="text"
            placeholder="UserName"
            name="UserName"
            onChange={handleChange}
            value={details.UserName}
            ref={UserName}
          />

          {errors.Username && (
            <p className="error-message2">{errors.Username}</p>
          )}

          <input
            className="email"
            type="email"
            name="email"
            id="emailInputID"
            placeholder="email"
            onChange={handleChange}
            value={details.email}
            ref={email}
          />
          {errors.email && <p className="error-message3">{errors.email}</p>}

          <input
            className="number"
            type="number"
            name="number"
            id="numberInputID"
            placeholder="mobileNumber"
            onChange={handleChange}
            value={details.number}
            ref={number}
          />

          {errors.number && <p className="error-message4">{errors.number}</p>}

          <input
            className="checkbox"
            type="checkbox"
            name="checkbox"
            id=""
            onChange={handleChange}
            value={details.checkbox}
          />

          <p className="tickbox">Share my registration data with Superapp</p>
          </div>

          <button
            className="signUp"
            onClick={handleSubmit}
            disabled={
              details.name.length === 0 ||
              details.UserName.length === 0 ||
              details.email.length === 0 ||
              details.number.length === 0 ||
              details.checkbox === true ||
              disable === "submitted"
            }
          >
            SIGN UP
          </button>

          <p className="line1">
            By clicking on Sign up. you agree to Superapp
            <span className="Terms">Terms and Conditions of Use</span>
          </p>
          <p className="line2">
            To learn more about how Superapp collects, uses, shares and protects
            your personal data please head Superapp
            <span className="Terms"> Privacy Policy</span>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Registration;
